import React from 'react';
import { View, TextInput, Text, ImageBackground, TouchableOpacity, Button, StyleSheet } from 'react-native';
import WebView from 'react-native-webview'


function Ajuda({navigation}){
  return(
    <View > 
      <View style={styles.fundoWhite}>
        <Text style={styles.titulo}>Ajuda</Text>
       
      
          <WebView 
          source={{uri: 'https://www.youtube.com/watch?v=Em9jwmqPp'}}
            />
        
      </View>
      
      <View style={styles.fundoBlue}>
      </View>
      
   </View>
    
  )
};



const styles = StyleSheet.create({
  fundoWhite: {     
      height:"40%",
      backgroundColor : "#fff",
      alignItems: 'center',
      justifyContent: 'center',
      },

  fundoBlue: {
    
    height:"60%",
    backgroundColor : "#219EBC",
    alignItems: 'center',
    justifyContent: 'center',
  },

  titulo: {
    marginTop: 25,
    fontSize: 30,
    color: "#219ebc",
    fontWeight: "bold",
    marginLeft: 10,
    textAlign: "center" 
  },

  video: {
    borderColor: "black",
  }
      

  })


  export default Ajuda;
